void overdrive(q31_t *Input, q31_t *Output)
{
	DWORD LU;
	
	//If input signal is greater than our max we need to hard clip.  
	//Our table only had 2^16 entries and wrapping would be weird!
	
	if(*Input>SIGNAL_IN_MAX)
	{
		*Input = SIGNAL_IN_MAX;
	}
	else if(*Input<SIGNAL_IN_MIN)
	{
		*Input = SIGNAL_IN_MIN;
	}
	
	//Re-scale to get our input signal input into a 16-bit range1
	LU = (WORD)(((*Input)>>8)+32768);
	
	*Output = (q31_t)(atan_table[LU]<<8);
}




